import React from 'react';

function Card(data) {
    return(
        <div className='card'>
            <div className='card__picture'>
                <img src={data.img} alr={data.name}/>
            </div>
            <p>{data.name}</p>
            <p>{data.cost}</p>
        </div>
    )
}
export default Card;
